import React from 'react';
import { Container,Row,Col } from 'react-bootstrap';
import { useSelector } from 'react-redux';
import ClientCard from './ClientCard';
import { Link } from 'react-router-dom';
import "./ClientList.css"

const ClientList = () => {
    const clientDataSelector = useSelector(state=>state.client.clientData);
    console.log(clientDataSelector);
    return (
        <>
        <Container>
            <Row>

                {clientDataSelector && clientDataSelector.map(client => <Col lg={4} key={client.Id}><Link to={`/client/${client.Id}`}  style={{ color: 'inherit', textDecoration: 'inherit'}}><ClientCard  client={client}/></Link></Col>)}
                </Row> 

            
                </Container>
            
        </>
    );
}

export default ClientList;
